import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Infinite Scroll Images</h1>
      <div className="image-container shadow-5">
        <img src="https://images.unsplash.com/photo-1584479623602-ce7e88110145?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2250&q=80" alt="" />
